int base;
vector<int> a;

bool check(){
	vector<int> b(a.rbegin(),a.rend());
	vector<int> c(a.size()*2+10);
	int sz=a.size();
	for (int i=0;i<sz;i++)
		for (int j=0;j<sz;j++)
			c[i+j]+=a[i]*b[j];
	bool q=false;
	for (int i=0;i<2*sz+5;i++)
		if (c[i] >= base)
			q=true;
	if (!q)
		return false;
	for (int i=0;i<2*sz+5;i++){
		c[i+1]+=c[i]/base;
		c[i]%=base;
		if (c[i]!=0 && c[i]!=1)
			return false;			
	}
	return true;
}

void print(vector<int> a){
	int i=a.size()-1;
	for (;a[i]==0;--i);
	for (;i>=0;--i)
		printf("%d",a[i]);	
}

